import Button from "@mui/material/Button";
import styled from "styled-components";

function App() {
  return (
    <div className="App">
      <h1>Fetch</h1>
      <p>we won't stop trying to make fetch happen!</p>
      <bn>
        <Button variant="contained">Contained</Button>
      </bn>
    </div>
  );
}

export default App;

const bn = styled.div`
  color: black;
`;
